import { useEffect, useState } from "react";

const Home = () => {

    const [jokes, setJokes] = useState(null)

    useEffect( () => {
        fetch("https://api.chucknorris.io/jokes/random")
            .then(res => {
                return res.json()
            })
            .then(data => {
                console.log(data)
                setJokes(data)
            })
    }, [])

    return ( 
        <div className="home">
            <h1>Test</h1>
            {jokes.map( (joke) => (
                <div className="blog-preview" key={joke.id}>
                    <p>{joke.value}</p>
                </div>
            ))}
        </div>
    );
}
 
export default Home;
